import '../css/membership.css';
import React, { useState } from 'react';
import axios from 'axios';

function Membership() {
    const [inputs, setInputs] = useState({
        username: '',
        password: '',
        email: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setInputs(prevInputs => ({
            ...prevInputs,
            [name]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        console.log("Form data:", inputs);
        try {
            const response = await axios.post('http://localhost:8080/api/users/register', inputs, {
                headers: {
                    'Content-Type': 'application/json'
                }
            });
            console.log('Form Submit success:', response.data);
            alert("회원가입 성공");
            window.location.href = '/';
        } catch (error) {
            console.error('Form Submit error:', error);
            if (error.response) {
                console.log("Error response data:", error.response.data);
                alert(`${error.response.data}`);
            } else {
                alert('An error occurred. Please try again later.');
            }
        }
    };

    return (
        <div id="App">
            <div id="header" />
            <div id="body">
                <form id="MembershipForm" onSubmit={handleSubmit}>
                    <h2>회원가입</h2>
                    <input
                        type="text"
                        name="username"
                        placeholder="아이디"
                        value={inputs.username}
                        onChange={handleChange}
                        required
                    /><hr />
                    <input
                        type="password"
                        name="password"
                        placeholder="비밀번호"
                        value={inputs.password}
                        onChange={handleChange}
                        required
                    /><hr />
                    <input
                        type="email"
                        name="email"
                        placeholder="이메일"
                        value={inputs.email}
                        onChange={handleChange}
                        required
                    /><hr />
                    <button type="submit" id="membership_btn">
                        <span>회원가입</span>
                    </button>
                </form>
            </div>
            <div id="footer" />
        </div>
    );
}

export default Membership;
